import React, { Component } from "react";
import "../Css/Home.css";

class Home extends Component {

  renderPost = () => (
    <div class="post-loading">
      Multimedia student and a self-learning programmer through interesting projects.
    </div>
  )

  renderIntro = () => (
    <div cla>

    </div>
  )

  render() {
    return (
      <div>
        <h1 class="name">Mihkel Liblikman</h1>
            <div class="post-container">
              {this.renderPost()}
            </div>

            <div>
              {}
            </div>
        <div class="icon-bar">
  <a class="github"><i class="fa fa-github" aria-hidden="true"></i></a>
  <a href="#" class="twitter"><i class="fa fa-twitter"></i></a> 
  <a href="#" class="google"><i class="fa fa-google"></i></a> 
  <a href="#" class="linkedin"><i class="fa fa-linkedin"></i></a>
  <a href="#" class="youtube"><i class="fa fa-youtube"></i></a> 
</div>
      </div>

    );
  }
}

export default Home;
